import styled from 'styled-components';

const Layout = styled.div``;

const Item = (props) => {
  return (
    <Layout>
      <span>${props.price} </span>
      <button onClick={() => props.onDeletePress(props.price)}>X</button>
    </Layout>
  );
};

export default Item;
